Activez cette option pour empêcher le partage ou la vente de vos données personnelles.

Les lois sur la protection de la vie privée octroient aux résidents et résidentes de certains États le droit de refuser la vente ou le partage de données personnelles, dont la définition comprend le transfert et le partage de données à des tiers pour prédire vos préférences ou intérêts afin de personnaliser les publicités sélectionnées pour vous sur ces plateformes tierces. Si vous cochez cette option et refusez que Blizzard divulgue vos données personnelles à des fins qualifiées de « vente » ou de « partage » (si nous devions le faire à l’avenir), nous ne vendrons ni ne partagerons vos données personnelles collectées dans ce jeu et sur votre compte Blizzard, y compris à nos partenaires publicitaires. 

Pour en savoir plus sur les données personnelles collectées par Blizzard et vos droits en la matière, consultez notre politique de confidentialité sur {c_highlight}https://www.blizzard.com/fr-fr/legal{/c}
